import React, { Component } from "react";

class LatestArticle extends Component {
  state = {};
  render() {
    return (
      <div>
        <div
          style={{
            height: 20,
            width: 20,
            backgroundColor: "black",
            position: "relative",
            bottom: -150,
            right: -100,
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div
            style={{
              position: "absolute",
              left: 30,
              fontFamily: "Unna, serif",
              fontStyle: "weight",
              fontSize: 35,
            }}
          >
            Featured
          </div>
        </div>
      </div>
    );
  }
}

export default LatestArticle;
